const ROUTES = {
    AUTH: '/auth',
    APP: '/app',
}

const API_ROUTES = {
    AUTH_STATUS: '/api/auth/auth-status',
    AUTH_LOGIN: '/api/auth/auth-login',
    AUTH_LOGOUT: '/api/auth/auth-logout'
}

const AWS = {
    API_NAME: 'cutoverplan-api'
}


const ENUMS = {
    ROUTES,
    API_ROUTES,
    AWS
}

export default ENUMS;
